import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Button, TextField, Container, Typography, Grid, Paper, Select, MenuItem, Card, CardContent } from '@material-ui/core';

const TimeTable = () => {
  const [timetable, setTimetable] = useState([]);
  const [day, setDay] = useState('');
  const [date, setDate] = useState('');
  const [subject, setSubject] = useState('');
  const [time, setTime] = useState('');

  useEffect(() => {
    fetchTimetable();
  }, []);

  const fetchTimetable = () => {
    axios.get('http://localhost:5678/timetable/getAll')
      .then(response => setTimetable(response.data))
      .catch(error => console.error('Error fetching timetable:', error));
  };

  const handleDelete = async (timetableId) => {
    try {
      const response = await axios.delete(`http://localhost:5678/timetable/delete/${timetableId}`);
      console.log('Response:', response.data);
      fetchTimetable();
    } catch (error) {
      console.error('Error deleting timetable entry:', error);
    }
  };

  const handleFormSubmit = async () => {
    try {
      const newEntry = { day, date, subjects: [{ subject, time }] };
      const response = await axios.post('http://localhost:5678/timetable/create', newEntry);
      console.log('Response:', response.data);
      clearForm();
      fetchTimetable();
    } catch (error) {
      console.error('Error submitting form:', error);
    }
  };

  const clearForm = () => {
    setDay('');
    setDate('');
    setSubject('');
    setTime('');
  };

  return (
    <Container>
      <Paper elevation={3} style={{ padding: '20px', margin: '20px 0' }}>
        <Typography variant="h4" gutterBottom>
          Timetable Management
        </Typography>
        <form>
          <Grid container spacing={2}>
            <Grid item xs={12} md={6}>
              <TextField
                label="Day"
                variant="outlined"
                fullWidth
                value={day}
                onChange={(e) => setDay(e.target.value)}
              />
            </Grid>
            <Grid item xs={12} md={6}>
              <TextField
                label="Date"
                variant="outlined"
                fullWidth
                value={date}
                onChange={(e) => setDate(e.target.value)}
              />
            </Grid>
            <Grid item xs={12} md={6}>
              <TextField
                label="Subject"
                variant="outlined"
                fullWidth
                value={subject}
                onChange={(e) => setSubject(e.target.value)}
              />
            </Grid>
            <Grid item xs={12} md={6}>
              <TextField
                label="Time"
                variant="outlined"
                fullWidth
                value={time}
                onChange={(e) => setTime(e.target.value)}
              />
            </Grid>
            <Grid item xs={12}>
              <Button variant="contained" color="primary" onClick={handleFormSubmit}>
                Add Entry
              </Button>
            </Grid>
          </Grid>
        </form>

        <Typography variant="h5" gutterBottom style={{ marginTop: '20px' }}>
          Timetable Entries
        </Typography>

        <Grid container spacing={2}>
          {timetable.map(entry => (
            <Grid item xs={12} md={4} key={entry._id}>
              <Card>
                <CardContent>
                  <Typography variant="h6">{entry.day}</Typography>
                  <Typography variant="body2" color="textSecondary">{entry.date}</Typography>
                  {entry.subjects.map((subject, index) => (
                    <div key={index}>
                      <Typography variant="body2" color="textSecondary">Subject: {subject.subject}</Typography>
                      <Typography variant="body2" color="textSecondary">Time: {subject.time}</Typography>
                    </div>
                  ))}
                  <Button variant="outlined" color="secondary" onClick={() => handleDelete(entry._id)}>
                    Delete
                  </Button>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Paper>
    </Container>
  );
};

export default TimeTable;
